import React from "react";
const DUMMYEVENTS = [
  {
    id: "e1",
    name: "teachers-day",
    place: "rajnagar",
    date: "27 may 2024",
    time: "6pm",
  },
  {
    id: "e2",
    name: "independenceDay",
    place: "kalyanpur",
    date: "15 aug 2024",
    time: "8am",
  },
  {
    id: "e3",
    name: "rakshaBandhan",
    place: "bithoor",
    date: "15 aug 2024",
    time: "9:45am",
  },
];
function EventsPage() {
  return (
    <>
      <ul>
        {DUMMYEVENTS.map((event) => (
          <>
            <li>e</li>
          </>
        ))}
      </ul>
    </>
  );
}

export default EventsPage;
